let initialState = {
    dialogs: [
        {
            id: 1,
            name: "Oleg",
            img: "data:image/jpeg;base64,"
        },
        {
            id: 2,
            name: "Homa",
            img: "data:image/jpeg;base64,"
        },
        {
            id: 3,
            name: "Diana",
            img: "data:image/jpeg;base64,"
        },
        {
            id: 4,
            name: "Fat cat",
            img: "data:image/jpeg;base64,"
        },
        {
            id: 5,
            name: "Alena",
            img: "data:image/jpeg;base64,"
        },
        {
            id: 6,
            name: "Igor",
            img: "data:image/jpeg;base64,"
        },
    ],
    messages: [
        {id: 1, message: "Hi"},
        {id: 2, message: "Hello? how are you"},
        {id: 3, message: "You"},
        {id: 4, message: "Yeap"},
        {id: 5, message: "me"},
        {id: 6, message: "Melon is yellow"},
    ],
}

export const dialogsPageReducer = (state = initialState, action) => {
    switch (action.type) {
        case SEND_MESSAGE: {
            let body = action.newMessageBody
            return {
                ...state,
                messages: [...state.messages, {id: 6, message: body}],
            }
        }
        default:
            return state
    }
}

export const sendMessageCreator = (newMessageBody) => ({type: SEND_MESSAGE, newMessageBody})
